pragma solidity ^0.4.4;

import 'zeppelin-solidity/contracts/ownership/Ownable.sol';
import './FiatToken.sol';

contract MtPelerinTokens is Ownable {
  mapping (bytes3 => uint16) currencyMap;
  address[] currencies;

  string public name = "MtPelerin";
  string public country = "Switzerland";

  function MtPelerinTokens() {
  }

  /**
   * @dev called by the owner to create a new currency
   */
  function addCurrency(string _name, bytes3 _symbol) onlyOwner public returns (uint) {
     require(currencies.length < 2**16-1 
	&& currencyMap[_symbol] == 0);

     FiatToken token=new FiatToken(_name, _symbol);
     token.transferOwnership(owner);
     address tokenAddr = token;
     currencies.push(tokenAddr);
     currencyMap[_symbol]=uint16(currencies.length);
     return currencies.length;
  }

  /**
   * @dev called by the owner to delete a currency
   */
  function deleteCurrency(bytes3 _symbol) onlyOwner public {
     uint16 id = currencyMap[_symbol];

     if(id > 0) {
       currencyMap[_symbol]=0;
       if(currencies.length > 1) {
         FiatToken lastToken = FiatToken(currencies[currencies.length-1]);
         currencies[id-1] = lastToken;
         bytes3 symbol = lastToken.symbol();
         currencyMap[symbol]=id-1;
       }
       currencies.length--;
     }
  }

  /**
   * @dev called to retrieve a currency
   */
  function getCurrency(bytes3 _symbol) public constant returns (address) {
     uint id = currencyMap[_symbol];
     require(id > 0);

     return currencies[id-1];
  }

  /**
   * @dev called to retrieve a currency by Id
   */
  function getCurrencyById(uint16 _id) public constant returns (address) {
     require(_id > 0);
     return currencies[_id-1];
  }

  /**
   * @dev called to know how many currency are available
   */
  function getCurrencyCount() public constant returns (uint) {
     return currencies.length;
  }

}
